import React, { useState } from 'react';
import Login from './pages/Login';
import Main from './pages/Main';

import "./styles/index.css"

const App = () => {
    const [isLoggedIn, setIsLoggedIn] = useState(false);

    return (
        <div>
            {!isLoggedIn ? (
                <Login onLogin={() => setIsLoggedIn(true)} />
            ) : (
                <Main />
            )}
        </div>
    );
};

export default App;
